  false,\n\t\"url\": null,\n\t\"notes\": \"This data set was derived from surveys
  in Fagatele Bay National Marine Sanctuary, Pago Pago (Rainmaker and Aua), and Fagasa
  (Sita Bay and Cape Larsen) conducted in 2004 and 2007-2008. Parameters include coral,
  algal, or invertebrate species, coral colony diameter size, and non-living bottom
  type. Summaries of species identification from sites above and Ofu-Olosega Islands,
  Ta'u Island, Aunu'u, Manu'a, and Rose Atoll, based on historic surveys back to 1917
  are also given in spreadsheets. This is a working list put together by Dr. Charles
  Birkeland. Fish data were collected by Dr. Alison Green on the same dates and transects
  and are available in a separate NODC accession.\",\n\t\"license_title\": null,\n\t\"extras\":
